const Modal = (props) => {
  return (
    <>
      <div className="backdrop"></div>
      <div className="modal absolute bg-slate-600 left-0 right-0 mx-auto w-[50vw] p-5 rounded-lg flex flex-col items-center">
        <h2 className="font-bold text-2xl">{props.title}</h2>
        <p>{props.message}</p>
        <button className="bg-[#2a2a2a] text-white hover:bg-white hover:text-[#2a2a2a]">
          Okay
        </button>
      </div>
    </>
  );
};

export default Modal;
